INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(1, 'Avengers Endgame', , 4.00, 10920000, '2024-01-21 16:04:21', 'After Thanos, an intergalactic warlord, disintegrates half of the universe, the Avengers must reunite and assemble again to reinvigorate their trounced allies and restore balance.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(2, 'Elemental', , 3.50, 6120000, '2024-01-21 16:04:34', 'In a city where fire, water, land, and air residents live together, a fiery young woman and a go-with-the-flow guy discover something elemental: how much they actually have in common.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(9, 'Up', , 3.40, 5760000, '2024-01-21 21:44:23', 'Carl, an old widower, goes off on an adventure with the help of Russell, a boy scout, in his flying house to search for Paradise Falls, his wife\'s dream destination.'),
(21, '6/45', , 3.50, 6780000, '2024-01-21 22:32:11', '6/45 is a 2022 South Korean comedy film directed by Park Gyu-tae, starring Go Kyung-pyo, Lee Yi-kyung, Eum Moon-suk, Park Se-wan and Kwak Dong-yeon. The film depicts a comical encounter between South and North Korean soldiers over the 5.7 billion won lottery that crossed the Military Demarcation Line on the wind.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(22, 'Love Reset', , 3.10, 7140000, '2024-01-21 23:00:11', 'Love Reset is a 2023 South Korean romantic comedy film directed by Nam Dae-jung, starring Kang Ha-neul and Jung So-min. It revolves around a couple suffering from amnesia due to an unexpected accident, 30 days before the end of their marriage. It was released theatrically on October 3, 2023.'),
(23, 'Avatar: The Way of Water', , 4.50, 11520000, '2024-01-21 23:02:39', 'Avatar is an American media franchise created by James Cameron, which consists of a planned series of epic science fiction films produced by Lightstorm Entertainment and distributed by 20th Century Studios, as well as associated merchandise, video games and theme park attractions.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(24, 'The Boy and the Heron', , 2.80, 7440000, '2024-01-21 23:13:00', 'Mahito, a young 12-year-old boy, struggles to settle in a new town after his mother\'s death. However, when a talking heron informs Mahito that his mother is still alive, he enters an abandoned tower in search of her, which takes him to another world.'),
(25, 'Spider-Man: No Way Home ', , 3.70, 8880000, '2024-01-21 23:16:07', 'Spider-Man seeks the help of Doctor Strange to forget his exposed secret identity as Peter Parker. However, Strange\'s spell goes horribly wrong, leading to unwanted guests entering their universe.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(26, 'Minions: The Rise of Gru', , 3.50, 5280000, '2024-01-21 23:19:14', 'In the 1970s, young Gru tries to join a group of supervillains called the Vicious 6 after they oust their leader -- the legendary fighter Wild Knuckles. When the interview turns disastrous, Gru and his Minions go on the run with the Vicious 6 hot on their tails. Luckily, he finds an unlikely source for guidance -- Wild Knuckles himself -- and soon discovers that even bad guys need a little help from their friends.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(27, 'Everything Everywhere All at Once', , 3.20, 8340000, '2024-01-21 23:23:57', 'A Chinese immigrant gets unwillingly embroiled in an epic adventure where she must connect different versions of herself in the parallel universe to stop someone who intends to harm the multiverse.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(28, 'Em va Trinh', , 2.40, 8160000, '2024-01-21 23:29:18', 'Em va Trinh is a Vietnamese film released in 2022, belonging to the genres of romance and drama. It was directed, written, and co-produced by Phan Gia Nhat Linh, drawing inspiration from the life of the late musician Trinh Cong Son.'),
(29, 'Jujutsu Kaisen 0', , 3.10, 6300000, '2024-01-21 23:34:10', 'Yuta Okkotsu gains control of an extremely powerful, cursed spirit and gets enrolled in the Tokyo Prefectural Jujutsu High School by sorcerers to help him control his power and keep an eye on him.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(30, 'Avengers: Infinity War', , 4.00, 8940000, '2024-01-22 13:03:59', 'The Avengers must stop Thanos, an intergalactic warlord, from getting his hands on all the infinity stones. However, Thanos is prepared to go to any lengths to carry out his insane plan.'),
(31, 'Avatar', , 4.70, 9720000, '2024-01-22 13:07:34', 'Jake, a paraplegic marine, replaces his brother on the Na\'vi-inhabited Pandora for a corporate mission. He is accepted by the natives as one of their own, but he must decide where his loyalties lie.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(33, 'Honey Sweet', , 3.20, 7140000, '2024-01-22 13:13:31', 'Honey Sweet is a 2023 South Korean romantic comedy film directed by Lee Han, starring Yoo Hae-jin, Kim Hee-sun, Cha In-pyo, Jin Seon-kyu and Han Sun-hwa. It was released on August 15, 2023.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(34, 'Doctor Strange in the Multiverse of Madness', , 3.70, 7560000, '2024-01-22 13:16:03', 'Doctor Strange teams up with a mysterious teenage girl from his dreams who can travel across multiverses, to battle multiple threats, including other-universe versions of himself, which threaten to wipe out millions across the multiverse.'),
(35, 'Black Panther: Wakanda Forever', , 3.30, 9660000, '2024-01-22 13:18:36', 'Queen Ramonda, Shuri, M\'Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T\'Challa\'s death. As the Wakandans strive to embrace their next chapter, the heroes must band together with Nakia and Everett Ross to forge a new path for their beloved kingdom.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(36, 'Thor: Love and Thunder', , 3.60, 7080000, '2024-01-22 13:20:41', 'Thor embarks on a journey unlike anything he\'s ever faced a quest for inner peace. However, his retirement gets interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods. To combat the threat, Thor enlists the help of King Valkyrie, Korg and ex-girlfriend Jane Foster, who to his surprise inexplicably wields his magical hammer. Together, they set out on a harrowing cosmic adventure to uncover the mystery of the God Butcher\'s vengeance.'),
(37, 'Dune', , 3.30, 9360000, '2024-01-22 13:25:53', 'Paul Atreides arrives on Arrakis after his father accepts the stewardship of the dangerous planet. However, chaos ensues after a betrayal as forces clash to control melange, a precious resource.');
INSERT INTO `movie` (`ID`, `Name`, `Image`, `Price`, `Duration`, `DateCreated`, `Des`) VALUES
(38, 'Mortal Kombat', , 3.20, 6600000, '2024-01-22 13:27:08', 'Cole Young, a washed-up MMA fighter, is chosen to join a team of champions in a high-stakes battle to prevent the Earth from being taken over by Outworld.'),
(39, 'Godzilla vs. Kong', , 3.70, 6780000, '2024-01-22 13:28:21', 'King Kong is transported out of his containment zone after Godzilla resurfaces and creates mayhem. Humans need his help to reach Hollow Earth and find a way to subdue the king of the monsters.');

